import React, { Component } from 'react'
import { thisTypeAnnotation } from '@babel/types';

export default class App extends Component {
    constructor(props) {
      super(props)

      this.state = {
         data : [
            {
                component : 'React',
                id : 1
            },
            {
                component : 'PHP',
                id : 2
            },
            {
                component : 'Angular',
                id : 3
            },
            {
                component : 'Swift',
                id : 4
            }
         ]
      }

    }

  render() {
    return (
      <div>
        <div> 
            <ul>
                {this.state.data.map((number) =>
                    <li key={number} />
                )}
            </ul>
        </div>
      </div>
    )
  }
}
